-- DROP DATABASE IF EXISTS FORMOSA;
-- CREATE DATABASE FORMOSA;
-- USE FORMOSA;
SET NAMES UTF8;
DROP TABLE IF EXISTS CHAMCONG, LUONG, PHANCONG, CONGVIEC, TINH, CONGNHAN, NHANVIENDACTHU, QUANLY, KHAU, XUONG;

CREATE TABLE TINH
(
	MATINH TINYINT, -- PK
    TENTINH NVARCHAR(30)
) CHARACTER SET UTF8 COLLATE utf8_general_ci;

CREATE TABLE CONGNHAN
(
	MACN CHAR(11) NOT NULL, -- PK
    HOTEN NVARCHAR(100),
    NGAYSINH DATE,
    MATINH TINYINT, -- FK
    GIOITINH NVARCHAR(3),
    GHICHU NVARCHAR(255)
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE QUANLY
(
	MAQL CHAR(11) NOT NULL, -- PK
    HOTEN NVARCHAR(100),
    NGAYSINH DATE,
    MATINH TINYINT, -- FK
    GIOITINH NVARCHAR(3),
    LUONG INT
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE NHANVIENDACTHU
(
	MANV CHAR(11) NOT NULL, -- PK
    HOTEN NVARCHAR(100),
    NGAYSINH DATE,
    CONGVIEC NVARCHAR(255),
    MATINH TINYINT, -- FK
    GIOITINH NVARCHAR(3),
    LUONG INT
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE CONGVIEC
(
	LOAISP ENUM('CBT', 'PLC'), -- PK
	MACV TINYINT, -- PK
    TENCV NVARCHAR(100)
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE XUONG
(
	MAXUONG CHAR(5), -- PK
    TENXUONG NVARCHAR(50)
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE KHAU
(
	MAKHAU CHAR(5), -- PK 
    TENKHAU NVARCHAR(100)
) CHARACTER SET UTF8 COLLATE UTF8_GENERAL_CI;

CREATE TABLE PHANCONG
(
	MAKHAU CHAR(5), -- PK
    MACN CHAR(11), -- PK
    MACV TINYINT
);

CREATE TABLE LUONG
(
	MAKHAU CHAR(5), -- PK
    LUONG INT
);
 CREATE TABLE CHAMCONG
 (
	NAM SMALLINT, -- PK
	THANG TINYINT, -- PK,
	MACN CHAR(11), -- PK
    NGAYLAM TINYINT
 );

ALTER TABLE TINH ADD CONSTRAINT PRIMARY KEY (MATINH);
ALTER TABLE CONGNHAN ADD CONSTRAINT PRIMARY KEY (MACN);
ALTER TABLE CONGNHAN ADD CONSTRAINT FOREIGN KEY (MATINH) REFERENCES TINH(MATINH) ON UPDATE CASCADE;

ALTER TABLE QUANLY ADD CONSTRAINT PRIMARY KEY (MAQL);
ALTER TABLE QUANLY ADD CONSTRAINT FOREIGN KEY (MATINH) REFERENCES TINH(MATINH) ON UPDATE CASCADE;

ALTER TABLE NHANVIENDACTHU ADD CONSTRAINT PRIMARY KEY (MANV);
ALTER TABLE NHANVIENDACTHU ADD CONSTRAINT FOREIGN KEY (MATINH) REFERENCES TINH(MATINH) ON UPDATE CASCADE;

ALTER TABLE CONGVIEC ADD CONSTRAINT PRIMARY KEY (LOAISP, MACV);

ALTER TABLE XUONG ADD CONSTRAINT PRIMARY KEY (MAXUONG);
ALTER TABLE KHAU ADD CONSTRAINT PRIMARY KEY (MAKHAU);

ALTER TABLE PHANCONG ADD CONSTRAINT PRIMARY KEY (MAKHAU, MACN);
ALTER TABLE LUONG ADD CONSTRAINT PRIMARY KEY (MAKHAU);
ALTER TABLE CHAMCONG ADD CONSTRAINT PRIMARY KEY(NAM, THANG, MACN);

